import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { NavLink } from 'react-router-dom';
import HomeIcon from '@material-ui/icons/Home';
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import InfoIcon from '@material-ui/icons/Info'; 
import MenuIcon from '@material-ui/icons/Menu';
import GroupIcon from '@material-ui/icons/Group';
import { Button } from '@material-ui/core';

import clsx from 'clsx';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import MailIcon from '@material-ui/icons/Mail';

const useStyles = makeStyles((theme) => ({
  list: {
    width: 250,
  },
  fullList: {
    width: 'auto',
  },
    grow: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    title: {
      display: 'none',
      [theme.breakpoints.up('sm')]: {
        display: 'block',
      },
    },
    sectionDesktop: {
      display: 'none',
      [theme.breakpoints.up('md')]: {
        display: 'flex',
        justifyContent: 'center',
      },
    },
    sectionMobile: {
      display: 'flex',
      [theme.breakpoints.up('md')]: {
        display: 'none',
      },
    },
    link: {
      color: 'black',
      paddingTop: '20px',
      paddingBottom: '20px',
      textDecoration: 'none',
    },
  }));

//image to be displayed on header of Home Page
export default function NavigationBar(props) {
    const classes = useStyles();

    const [state, setState] = React.useState({
      right: false,
    });
  
    const toggleDrawer = (anchor, open) => (event) => {
      if (event && event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
      }
  
      setState({ ...state, [anchor]: open });
    };
  
    const list = (anchor) => (
      <div
        className={clsx(classes.list, {
          [classes.fullList]: anchor === 'top' || anchor === 'bottom',
        })} 
        role="presentation"
        onClick={toggleDrawer(anchor, false)}
        onKeyDown={toggleDrawer(anchor, false)}
      >
        <List>
          <NavLink className={classes.link} activeClassName="active" to="/" exact>
            <ListItem button className={classes.listitem}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText>HOME</ListItemText>
            </ListItem>
          </NavLink>
          <Divider />
          <NavLink className={classes.link} activeClassName="active" to="/" exact>
            <ListItem button className={classes.listitem}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText>HOME</ListItemText>
            </ListItem>
          </NavLink>
          <Divider />
          <NavLink className={classes.link} activeClassName="active" to="/" exact>
            <ListItem button className={classes.listitem}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText>HOME</ListItemText>
            </ListItem>
          </NavLink>
          <Divider />
          <NavLink className={classes.link} activeClassName="active" to="/" exact>
            <ListItem button className={classes.listitem}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText>HOME</ListItemText>
            </ListItem>
          </NavLink>
          <Divider />
          <NavLink className={classes.link} activeClassName="active" to="/" exact>
            <ListItem button className={classes.listitem}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText>HOME</ListItemText>
            </ListItem>
          </NavLink>
          <Divider/>
        </List>
      </div>
    );
  

    return (
      <>
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" >
                    BECOMING BUSINESSWOMEN
                </Typography>

                <div className={classes.grow} />

                <div className={classes.sectionDesktop}>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/" exact>HOME</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/about" exact>ABOUT US</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/our-team" exact>OUR TEAM</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/join" exact>JOIN US</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/contact" exact>CONTACT</NavLink>
                    </Button>
                </div>
                <div className={classes.sectionMobile}>
                    <Button onClick={toggleDrawer('right', true)}><MenuIcon/></Button>
                    <SwipeableDrawer
                      anchor='right'
                      open={state['right']}
                      onClose={toggleDrawer('right', false)}
                      onOpen={toggleDrawer('right', true)}
                    >
                      {list('right')}
                    </SwipeableDrawer>
                </div>
            </Toolbar>
        </AppBar>
      </>
    )
}
